const Doge = {
  shown: false,
  /* здесь остались только призраки прошлого вк... */
  show() {
    if (this.shown) return;
    this.shown = true;

    let dogeDom = document.getElementById('vk_doge');
    let textDom = document.getElementById('vk_doge_wow');

    if (!dogeDom) {
      let nichosi = `data:image/png;base64,`;
      let nichositext = `data:image/png;base64,`;

      dogeDom = document.createElement('a');
      dogeDom.id = 'vk_doge';
      dogeDom.innerHTML = `<img src="${nichosi}" width="256" height="196">`;
	  dogeDom.onclick = function() {Doge.hide()};
      Object.assign(dogeDom.style, {
        position: 'fixed',
        bottom: '-200px',
        right: '20px',
        width: '256px',
        height: '196px',
        padding: '10px',
        zIndex: '110',
        transition: 'bottom 0.5s cubic-bezier(0.3, 1.5, 0.5, 1)',
      });

      textDom = document.createElement('div');
      textDom.id = 'vk_doge_wow';
      textDom.innerHTML = `<img src="${nichositext}" width="256" height="60">`;
	  textDom.onclick = function() {Doge.hide()};
      Object.assign(textDom.style, {
        position: 'fixed',
        bottom: '-200px',
        right: '20px',
        width: '256px',
        height: '60px',
        padding: '10px',
        zIndex: '120',
        transition: 'bottom 0.5s cubic-bezier(0.3, 1.5, 0.5, 1)',
      });

      document.body.appendChild(dogeDom);
      document.body.appendChild(textDom);
    } else {
      dogeDom.style.display = 'block';
      dogeDom.style.bottom = '-200px';
      textDom.style.display = 'block';
      textDom.style.bottom = '-200px';
    }

    setTimeout(() => {
      dogeDom.style.bottom = '-35px';
    }, 50);

    setTimeout(() => {
      textDom.style.bottom = '165px';
    }, 150);

    setTimeout(() => this.hide(), 1000);
  },

  hide() {
    let dogeDom = document.getElementById('vk_doge');
    let textDom = document.getElementById('vk_doge_wow');

    if (dogeDom) {
      setTimeout(() => {
        dogeDom.style.bottom = '-500px';
      }, 50);
      setTimeout(() => {
        textDom.style.bottom = '-250px';
      }, 300);

      setTimeout(() => {
        dogeDom.style.display = 'none';
        textDom.style.display = 'none';
        this.shown = false;
      }, 500);
    }
  },
};

